#include <fstream>
#include <algorithm>

int main() {
    std::ifstream infile("multimi.in");
    std::ofstream outfile("multimi.out");

    int n;
    infile >> n;

    int max_low = 0;
    int min_high = 30000;

    for (int i = 0; i < n; ++i) {
        int low, high;
        infile >> low >> high;
        if (low > max_low) {
            max_low = low;
        }
        if (high < min_high) {
            min_high = high;
        }
    }

    if (max_low <= min_high) {
        for (int i = max_low; i <= min_high; ++i) {
            outfile << i << " ";
        }
    } else {
        outfile << "multimea vida";
    }

    infile.close();
    outfile.close();
    return 0;
}
